description:
Евангелист «ВКонтакте» Александра Черкас расскажет, как правильно вести сообщество «ВКонтакте», поделится важными советами и некоторыми секретами ведения сообщества в нынешнем 2018 году, а также:

- про бесплатные инструменты;
- про оформление;
- про возможности коммуникации со своей аудиторией;
- про контент: каким он должен быть, правильное оформление поста и частота публикаций.
